/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `Accompany`.`sensorLogTrigger`
AFTER INSERT ON `Accompany`.`SensorLog`
FOR EACH ROW
BEGIN

    UPDATE Sensors SET lastActiveValue = value, 
                       lastTimeActive = lastUpdate, 
                       lastStatus  = status, 
                       value = NEW.value, 
                       lastUpdate = NEW.timestamp,
                       status = NEW.status  
                           where Sensors.sensorId = NEW.sensorId;   

  END */;;
