CREATE DEFINER=`root`@`localhost` FUNCTION `fnGetSchedulerDateTime`() RETURNS char(19) CHARSET latin1
BEGIN
   select convert(DATE_ADD(NOW(),INTERVAL SessionTimeOffsetHours HOUR),CHAR) FROM Accompany.SessionControl INTO @timePlusHours;

-- add minutes to the current time

   select convert(DATE_ADD(@timePlusHours ,INTERVAL SessionTimeOffsetMin MINUTE),CHAR) FROM Accompany.SessionControl INTO @timePlusHoursMins;

   return @timePlusHoursMins;
END ;;
DELIMITER ;
