CREATE DEFINER=`root`@`localhost` PROCEDURE `spBetweenTimeCheck`(IN startTime CHAR(8), IN endTime CHAR(8))
begin

--
-- Checks whether the current time plus session offsets (held in session table) are between given times
-- JS Oct 12 


-- add hours to the current time

select convert(DATE_ADD(NOW(),INTERVAL SessionTimeOffsetHours HOUR),CHAR) FROM Accompany.SessionControl INTO @timePlusHours;

-- add minutes to the current time

select convert(DATE_ADD(@timePlusHours ,INTERVAL SessionTimeOffsetMin MINUTE),CHAR) FROM Accompany.SessionControl INTO @timePlusHoursMins;

-- see if the new time is between the given times

SELECT 1 from DUAL Where (SELECT TIMEDIFF(time(@timePlusHoursMins) ,startTime) > 0) AND (SELECT TIMEDIFF(time(@timePlusHoursMins) ,endTime) < 0);
 
 
end ;;
DELIMITER ;
