DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `spCheckRobotLocation`(IN QuestionRobotId INT, IN QuestionLocationId INT, INOUT rowcnt INT)
begin 

-- Due to the hierachical nature of the Locations table a query that says
-- e.g. is the robot in the dining room? means that the robot could be
-- in the dining room, or at any sub location of the dining room

-- this procedure traverses the hierachy from level 2 to level 4 to check this.
-- e.g. is robot 2 in location 25 
-- call checkRobotLocation(2,25)
-- if true then returns the actual robot location, else returns nothing (no rows) 
-- the query  - is the robot in the robot house? (level 1) will alays return a row
--
-- Joe Oct 12 

SELECT count(*) into rowcnt FROM Robot WHERE (locationId IN  
  (  
    select c.locationId 
       from (select b.* from Locations a, Locations b
              where a.locationId = QuestionLocationId
                and  a.locationId = b.where) b, Locations c
      where b.locationId = c.where
     UNION
   select b.locationId  from Locations a, Locations b
      where a.locationId = QuestionLocationId
        and a.locationId = b.where
     UNION
    select b.locationId  from Locations b
      where b.locationId = QuestionLocationId)
and robotId = QuestionRobotId) or
(QuestionLocationId = 0 and robotId = QuestionRobotId);

IF rowcnt > 0 THEN  
        SELECT rowcnt;  
END IF; 

end ;;
DELIMITER ;
